import styled, { css } from "styled-components";


const StyledCommunity = styled.a`
  font-weight: 700;
  font-size: 18px;
  line-height: 25px;
  white-space: nowrap;
  color: #2182d9;
`

type CommunityPropsType = {
    path: string
    text: string
}

function Community(props:XXX) {
    return (
        <StyledCommunity href={props.YYY}>
            {props.ZZZ}
        </StyledCommunity>
    );
}

const root = ReactDOM.createRoot(document.getElementById('root') as HTMLElement);
root.render(
    <div className="App">
        <Community path="https://hotmart.s3.amazonaws.com/product_pictures/ccdb08be-d4d5-467b-8491-a88bf61024bc/guiahtml38051.png" text="See Community" />
    </div>
);


